import React, { Component } from "react";

class Image extends Component {
  render() {
    return (
      <img
        src="https://d2rbodpj0xodc.cloudfront.net/stories/918962597426889946/1c5f7561-938f-455a-b9f0-a322c12ea214.jpeg"
        width="400"
        height="600"
      />
    );
  }
}

export default Image;
